var presets = [];
var searchDisplayPresets = []; //Contains i s.t. presets[i][0] is the searched for preset. presets[i][1] is the relevance. 
function preset(src, tags=[], options, simText){
	this.chapter = 0;
	this.problem = 0;
	this.tags = tags;
	this.imgSrc = "images/presetThumbnails/" + src.toString() + ".png";
	if(typeof(options.chapter) != "undefined"){
		this.chapter = options.chapter;
	}
	if(typeof(options.problem) != "undefined"){
		this.problem = options.problem;
	}
	this.simText = simText;
	this.camText = '[{"number":0,"pos":[0,0],"screenPos":[0,0],"sizeMultiplier":0.6,"dim":[1200,600]}]';
	if(typeof(options.camText) != "undefined"){
		this.camText = options.camText;
	}
}
function updateSearch(){
	var t = findStartIndex(0, ui.textFields);
	var chapter = parseInt(ui.textFields[t].value);
	var problem = parseInt(ui.textFields[t+1].value);
	var tagString = ui.textFields[t+2].value;
	var tags = tagString.split(" ");
	function relevanceFromTags(tags, pTags){ //pTags is tags of the preset
		var relevance = 0;
		for(var q = 0; q < tags.length; q++){
			for(var g = 0; g < pTags.length; g++){
				if((aSimB(tags[q], pTags[g])+aSimB(pTags[g], tags[q]))/2 > 0.4){ //Checks if the tags match up
					relevance += 1;
				}
			}
		}
		return relevance;
	}
	//Chapter+tags, chapter+problem, tags
	//I think it's more efficient to split into 3 different if conditions
	searchDisplayPresets = [];
	if(chapter != 0){
		if(problem == 0){
			for(var i = 0; i < presets.length; i++){ //Based on chapter and tags
				if(presets[i].chapter == chapter){
					var relevance = relevanceFromTags(tags, presets[i].tags);
					searchDisplayPresets.push([i, relevance]);
				}
			}
		}
		else{
			for(var i = 0; i < presets.length; i++){ //Looks only at chapter and problem
				if(presets[i].chapter == chapter && presets[i].problem == problem){
					searchDisplayPresets.push([i, 1]);
				}
			}
		}
	}
	else{ //Based on tags only
		if(tags[0] == "" && tags.length == 1){ //Shows all if the search bars are empty
			for(var i = 0; i < presets.length; i++){
				searchDisplayPresets.push([i, 0]);
			}
		}
		else{ //Otherwise uses available tags
			for(var i = 0; i < presets.length; i++){
				var relevance = relevanceFromTags(tags, presets[i].tags);
				if(relevance > 0){
					searchDisplayPresets.push([i, relevance]);
				}
			}
		}
	}
	//Now gonna sort by relevance
	searchDisplayPresets.sort(function(a, b){
		if(a[1] < b[1]){
			return 1; //Swapped from -1 bc we want high to low
		}
		if(a[1] > b[1]){
			return -1; //Swapped from 1 bc we want low to high
		}
		if(a[1] == b[1]){
			return 0;
		}
	});
}
